import React, { PureComponent } from "react";

class DropDown2 extends PureComponent {
  constructor(props) {
    super(props);

    this.state = {
      isActive: false,
    };
  }

  render() {
    return (
      <div className="dropdown">
        <div>
          <h2 className="dropdown-header">
            <button
              className="dropdown-btn round-corner "
              onClick={() => this.setState(!this.state.isActive)}
            >
              {this.props.displayItem}
            </button>

            {this.state.isActive && (
              <div className="dropdown-content">
                <div
                  className="dropdown-item"
                  aria-labelledby="dropdownMenuButton"
                >
                  <form onSubmit={() => this.searchApplication}></form>
                </div>
              </div>
            )}
          </h2>
        </div>
      </div>
    );
  }
}

export default DropDown2;
